import React from "react";


function PlayStoreDownloadBtn(){
    return <button type="button" id="DownloadBtn" className="btn btn-dark" ><p id="supOfPlayBtn">GET IT On</p><img src="playstore.png" id="Img" /><h5 id="buttonHeading"> Google Play</h5></button>;
}

export default PlayStoreDownloadBtn;
